} The bound on T makes it so that Fx<T, F> can be added any time that T can be added to its own type with itself as the output. We can use the exact same pattern for Sub , Shl , Shr , and Neg . With enough trait bounds, we can do anything! impl<T: Sub<Output = T>, F: Unsigned> Sub for Fx<T, F> { type Output = Self; fn sub(self, rhs: Fx<T, F>) -> Self::Output { Fx { num: self.num - rhs.num, phantom: PhantomData, } }
