This is where things get more interesting. When we have two numbers A and B they really stand for (a*f) and (b*f) . If we write A*B then we're really writing (a*f)*(b*f) , which can be rewritten as (a*b)*2f , and now it's obvious that we have one more f than we wanted to have. We have to do the multiply of the inner value and then divide out the f . We divide by 1 << bit_count , so if we have 8 fractional bits we'll divide by 256. The catch is that, when we do the multiply we're extremely likely to overflow our base type with that multiplication step. Then we do that divide, and now our result is basically nonsense. We can avoid this to some extent by casting up to a higher bit type, doing the multiplication and division at higher precision, and then casting back down. We want as much precision as possible without being too inefficient, so we'll always cast up to 32-bit (on a 64-bit machine you'd cast up to 64-bit instead). Naturally, any signed value has to be cast up to i32 and any unsigned value has to be cast up to u32 , so we'll have to handle those separately. Also, instead of doing an actual divide we can right-shift by the correct number of bits to achieve the same effect. Except when we have a signed value that's negative, because actual division truncates towards zero and right-shifting truncates towards negative infinity. We can get around this by flipping the sign, doing the shift, and flipping the sign again (which sounds silly but it's so much faster than doing an actual division). Also, again signed values can be annoying, because if the value just happens to be i32::MIN then when you negate it you'll have... still a negative value. I'm not 100% on this, but I think the correct thing to do at that point is to give $t::MIN as out output num value. Did you get all that? Good, because this is involves casting, we will need to implement it three times, which calls for another macro. macro_rules! fixed_point_signed_multiply { ($t:ident) => { impl<F: Unsigned> Mul for Fx<$t, F> { type Output = Self; fn mul(self, rhs: Fx<$t, F>) -> Self::Output { let pre_shift = (self.num as i32).wrapping_mul(rhs.num as i32); if pre_shift < 0 { if pre_shift == core::i32::MIN { Fx { num: core::$t::MIN, phantom: PhantomData, } } else { Fx { num: (-((-pre_shift) >> F::U8)) as $t, phantom: PhantomData, } } } else { Fx { num: (pre_shift >> F::U8) as $t, phantom: PhantomData, } } } } };
} fixed_point_signed_multiply! {i8}
fixed_point_signed_multiply! {i16}
fixed_point_signed_multiply! {i32} macro_rules! fixed_point_unsigned_multiply { ($t:ident) => { impl<F: Unsigned> Mul for Fx<$t, F> { type Output = Self; fn mul(self, rhs: Fx<$t, F>) -> Self::Output { Fx { num: ((self.num as u32).wrapping_mul(rhs.num as u32) >> F::U8) as $t, phantom: PhantomData, } } } };
} fixed_point_unsigned_multiply! {u8}
fixed_point_unsigned_multiply! {u16}
fixed_point_unsigned_multiply! {u32}

