Division is similar to multiplication, but reversed. Which makes sense. This time A/B gives (a*f)/(b*f) which is a/b , one less f than we were after. As with the multiplication version of things, we have to up-cast our inner value as much a we can before doing the math, to allow for the most precision possible. The snag here is that the GBA has no division or remainder. Instead, the GBA has a BIOS function you can call to do i32/i32 division. This is a potential problem for us though. If we have some unsigned value, we need it to fit within the positive space of an i32 after the multiply so that we can cast it to i32 , call the BIOS function that only works on i32 values, and cast it back to its actual type. If you have a u8 you're always okay, even with 8 floating bits. If you have a u16 you're okay even with a maximum value up to 15 floating bits, but having a maximum value and 16 floating bits makes it break. If you have a u32 you're probably going to be in trouble all the time. So... ugh, there's not much we can do about this. For now we'll just have to suffer some. // TODO: find a numerics book that tells us how to do u32/u32 divisions. macro_rules! fixed_point_signed_division { ($t:ident) => { impl<F: Unsigned> Div for Fx<$t, F> { type Output = Self; fn div(self, rhs: Fx<$t, F>) -> Self::Output { let mul_output: i32 = (self.num as i32).wrapping_mul(1 << F::U8); let divide_result: i32 = crate::bios::div(mul_output, rhs.num as i32); Fx { num: divide_result as $t, phantom: PhantomData, } } } };
} fixed_point_signed_division! {i8}
fixed_point_signed_division! {i16}
fixed_point_signed_division! {i32} macro_rules! fixed_point_unsigned_division { ($t:ident) => { impl<F: Unsigned> Div for Fx<$t, F> { type Output = Self; fn div(self, rhs: Fx<$t, F>) -> Self::Output { let mul_output: i32 = (self.num as i32).wrapping_mul(1 << F::U8); let divide_result: i32 = crate::bios::div(mul_output, rhs.num as i32); Fx { num: divide_result as $t, phantom: PhantomData, } } } };
} fixed_point_unsigned_division! {u8}
