pub struct VolatilePtrIter<T> { vol_ptr: VolatilePtr<T>, slots: usize,
} And then we just implement core::iter::Iterator on that struct. Wow, that's quite the trait though! Don't worry, we only need to implement two small things and then the rest of it comes free as a bunch of default methods. So, the code that we want to write looks like this: impl<T> Iterator for VolatilePtrIter<T> { type Item = VolatilePtr<T>; fn next(&mut self) -> Option<VolatilePtr<T>> { if self.slots > 0 { let out = Some(self.vol_ptr); self.slots -= 1; self.vol_ptr = unsafe { self.vol_ptr.offset(1) }; out } else { None } }
} Except we can't write that code. What? The problem is that we used derive(Clone, Copy on VolatilePtr . Because of a quirk in how derive works, this means VolatilePtr<T> will only be Copy if the T is Copy , even though the pointer itself is always Copy regardless of what it points to . Ugh, terrible. We've got three basic ways to handle this: Make the Iterator implementation be for <T:Clone> , and then hope that we always have types that are Clone . Hand implement every trait we want VolatilePtr (and VolatilePtrIter ) to have so that we can override the fact that derive is basically broken in this case. Make VolatilePtr store a usize value instead of a pointer, and then cast it to *mut T when we actually need to read and write. This would require us to also store a PhantomData<T> so that the type of the address is tracked properly, which would make it a lot more verbose to construct a VolatilePtr value. None of those options are particularly appealing. I guess we'll do the first one because it's the least amount of up front trouble, and I don't think we'll need to be iterating non-Clone values. All we do to pick that option is add the bound to the very start of the impl block, where we introduce the T : impl<T: Clone> Iterator for VolatilePtrIter<T> { type Item = VolatilePtr<T>; fn next(&mut self) -> Option<VolatilePtr<T>> { if self.slots > 0 { let out = Some(self.vol_ptr.clone()); self.slots -= 1; self.vol_ptr = unsafe { self.vol_ptr.clone().offset(1) }; out } else { None } }
} What's going on here? Okay so our iterator has a number of slots that it'll go over, and then when it's out of slots it starts producing None forever. That's actually pretty simple. We're also masking some unsafety too. In this case, we'll rely on the person who made the VolatilePtrIter to have selected the correct number of slots. This gives us a new method for VolatilePtr : pub unsafe fn iter_slots(self, slots: usize) -> VolatilePtrIter<T> { VolatilePtrIter { vol_ptr: self, slots, } } With this design, making the VolatilePtrIter at the start is unsafe (we have to trust the caller that the right number of slots exists), and then using it after that is totally safe (if the right number of slots was given we'll never screw up our end of it).

