If you're going to do much with macros you should definitely read through The Little Book of Rust Macros , but we won't be doing too much so you can just follow along here a bit if you like. The most basic version of a newtype macro starts like this: #[macro_export]
macro_rules! newtype { ($new_name:ident, $old_name:ident) => { #[repr(transparent)] pub struct $new_name($old_name); };
} The #[macro_export] makes it exported by the current module (like pub kinda), and then we have one expansion option that takes an identifier, a , , and then a second identifier. The new name is the outer type we'll be using, and the old name is the inner type that's being wrapped. You'd use our new macro something like this: newtype! {PixelColorCurly, u16} newtype!(PixelColorParens, u16); newtype![PixelColorBrackets, u16]; Note that you can invoke the macro with the outermost grouping as any of () , [] , or {} . It makes no particular difference to the macro. Also, that space in the first version is kinda to show off that you can put white space in between the macro name and the grouping if you want. The difference is mostly style, but there are some rules and considerations here: If you use curly braces then you must not put a ; after the invocation. If you use parentheses or brackets then you must put the ; at the end. Rustfmt cares which you use and formats accordingly: Curly brace macro use mostly gets treated like a code block. Parentheses macro use mostly gets treated like a function call. Bracket macro use mostly gets treated like an array declaration.

